import { Component } from "react";
import Layout from "../components/shared/Layout.js";

class Index extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Layout page="Home">
        <section className="index"></section>
      </Layout>
    );
  }
}

export default Index;
